import React from 'react'
import './AllScenarios.css'

const AllScenarios = () => {
  return (
    <div className='container'>
      
      <h1>Scenario</h1>
      <div className='btn'><button className='btnadd'>Add</button><button className='btnreset'>Reset</button><button className='btngoback'>Go Back</button>
      </div>
      <div></div>
      
      
      </div>
  )
}

export default AllScenarios
